import React from 'react';
import {Container} from 'react-bootstrap'; 
import Header from './components/Header';
import Footer from './components/Footer';

const App = () => {
  return (
    <>
      <Header></Header>
      <main>
        <h1>Welcome to my shop!</h1>
      </main>

      <Footer></Footer>
    </>
  );
}

export default App;
